import './App.css';
import logoback from './img/logoback.png';
import goldisc from './img/cdgoldx110.png';
import bannerpc from './img/oldlogo1.0.png';
import cardfloat from './img/cardback.png';

function App() {
  return (
    <div className="App bg-black min-w-52 w-full h-screen flex justify-start items-center flex-col">

      <div className='fixed h-screen w-full flex justify-center items-center'>
        <img src={logoback} alt="****" className='blur-md'/>
      </div>

      <section className='w-11/12 pt-6 pb-6 z-0 flex justify-between items-center '>
        <img src={goldisc} alt="" className='xl:w-24 sm:w-20 w-16 animate-spinlow' />

        <nav className='text-white font-game xl:text-2xl sm:text-xl text-lg'>
          <a href="gle.com/" className='mr-8 hover:underline hover:animate-pulse decoration-purple-600 underline-offset-4 decoration-2'>HIRE</a>
          <a href="gle.com/" className=' hover:underline hover:animate-pulse decoration-purple-600 underline-offset-4 decoration-2'>SEE MORE</a>
        </nav>
      </section>

      <section className='z-0 w-11/12 h-full gap-5 flex justify-center items-center mt-48'>

        <div className='bg-transparent w-full h-full'>
          <div className='w-full mb-28'>
            <img src={bannerpc} alt="VideosLOGO" />
          </div>
          <p className='text-white font-mono'>
            Editor de vídeos e especialista em motion graphics, com mais de 1 milhão de visualizações em projetos anteriores. Criação stories e vídeos animados envolventes para redes sociais, utilizando técnicas avançadas para maximizar o impacto visual e o engajamento. Transforme suas ideias em conteúdos dinâmicos e envolventes com o poder audiovisual!
          </p>
        </div>

        <div className='w-full h-full flex justify-center '>

          <img src={cardfloat} alt="cardART" className='rounded-2xl animate-pinglow' />
          <img src={cardfloat} alt="" className='absolute rounded-2xl shadow-sm shadow-purple-700 '/>

        </div>

      </section>

    </div>
  );
}

export default App;
